R.forEach([1, 2, 3], x => {
  console.log(x)
}) // => [1, 2, 3]
R.forEach.indexed([1, 2, 3], (x, i) => {
  console.log(x, i)
}) // => [1, 2, 3]

R.pipe(
  [1, 2, 3],
  R.forEach(x => {
    console.log(x)
  })
) // => [1, 2, 3]
R.pipe(
  [1, 2, 3],
  R.forEach.indexed((x, i) => {
    console.log(x, i)
  })
) // => [1, 2, 3]

R.forEachObj({a: 1}, (val) => {
  console.log(`${val}`)
}) // "1"
R.forEachObj.indexed({a: 1}, (val, key, obj) => {
  console.log(`${key}: ${val}`)
}) // "a: 1"

